import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  ArcElement,
  BarElement,
  Tooltip,
  Legend
} from 'chart.js';
import { Line, Doughnut, Bar } from 'react-chartjs-2';
import BookmarkButton from '../components/BookmarkButton'; // ✅ Include this if you added bookmark functionality

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  BarElement,
  ArcElement,
  Tooltip,
  Legend
);

export default function ProjectProfilePage() {
  const { id } = useParams();
  const [project, setProject] = useState(null);
  const [history, setHistory] = useState({ stars: [], issues: [] });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    async function fetchData() {
      try {
        setLoading(true);
        const [projectRes, metricsRes] = await Promise.all([
          fetch(`/api/projects/${id}`),
          fetch(`/api/projects/${id}/metrics`)
        ]);

        if (!projectRes.ok || !metricsRes.ok) {
          throw new Error('Failed to load project data');
        }

        const projectData = await projectRes.json();
        const metricsData = await metricsRes.json();

        setProject(projectData);
        setHistory(metricsData);
        setLoading(false);
      } catch (err) {
        console.error(err);
        setError('Unable to load project details.');
        setLoading(false);
      }
    }

    fetchData();
  }, [id]);

  if (loading) return <p style={{ padding: '2rem' }}>Loading project details…</p>;
  if (error) return <p style={{ padding: '2rem', color: 'red' }}>{error}</p>;
  if (!project) return <p style={{ padding: '2rem' }}>No project data found.</p>;

  // Chart data processing
  const dates = history.stars.map(p => p.date);
  const starData = history.stars.map(p => p.count);
  const issueData = history.issues.map(p => p.count);

  const langLabels = Object.keys(project.languageBreakdown || {});
  const langValues = Object.values(project.languageBreakdown || {});

  return (
    <div style={{ padding: '2rem' }}>
      <h1>{project.name}</h1>
      <p>{project.description}</p>
      <a href={project.url} target="_blank" rel="noopener noreferrer">View on GitHub</a>
      <br />
      <BookmarkButton project={project} />

      <div style={{ display: 'flex', gap: '2rem', marginTop: '2rem', flexWrap: 'wrap' }}>
        <div style={{ flex: 1, minWidth: '300px' }}>
          <h3>Star Growth</h3>
          <Line
            data={{
              labels: dates,
              datasets: [
                {
                  label: 'Stars',
                  data: starData,
                  borderColor: 'blue',
                  backgroundColor: 'rgba(0, 0, 255, 0.2)',
                  tension: 0.3
                }
              ]
            }}
            options={{ responsive: true, maintainAspectRatio: false }}
            height={200}
          />
        </div>

        <div style={{ flex: 1, minWidth: '300px' }}>
          <h3>Open Issues Over Time</h3>
          <Bar
            data={{
              labels: dates,
              datasets: [
                {
                  label: 'Open Issues',
                  data: issueData,
                  backgroundColor: 'orange'
                }
              ]
            }}
            options={{ responsive: true, maintainAspectRatio: false }}
            height={200}
          />
        </div>

        <div style={{ flex: 1, minWidth: '300px' }}>
          <h3>Language Breakdown</h3>
          <Doughnut
            data={{
              labels: langLabels,
              datasets: [
                {
                  data: langValues,
                  backgroundColor: ['#4bc0c0', '#ff6384', '#ffcd56', '#36a2eb', '#9966ff', '#ff9f40']
                }
              ]
            }}
            options={{ responsive: true, maintainAspectRatio: false }}
            height={200}
          />
        </div>
      </div>
    </div>
  );
}
